import React, { Component } from 'react';

export default class Home extends Component{
    constructor(props){
        super(props);
        this.state = {

        }
    }

    render(){
        return(
            <div className="page">
                <div id="HeaderSection" class="defaultsection">
                    <div class="defaultcontainer">
                        <div class="navigationdiv nomarginbottom">
                            <a href="#" className="logo">Mooder</a>
                            <div class="headerspace" />
                            <ul className="headermenu">
                                    <li className="headermenuitem">sign on</li>
                                    <li className="headermenuitem">sign in</li>
                            </ul>
                        </div>
                    </div>
                </div>
                <div class="defaultsection main">
                    <div class="defaultcontainer">
                        <div class="contentdiv">
                        Content
                        </div>
                    </div>
                </div>
                <div className="blank" />
            </div>
        )
    }
}
